import React from 'react';
import Slelf from './Slelf';

const Shelves = ({ books, updateBookShelf }) => {

    const currentlyReading = books.filter((book) => book.shelf === "currentlyReading");
    const wantToRead = books.filter((book) => book.shelf === "wantToRead");
    const read = books.filter((book) => book.shelf === "read");



    //Moving Methods?

    return(
        <div>
            <Slelf title="Currently Reading" books={currentlyReading} updateBookShelf={updateBookShelf} ></Slelf>
            <Slelf title="Want To Read" books={wantToRead} updateBookShelf={updateBookShelf} ></Slelf>
            <Slelf title="Read" books={read} updateBookShelf={updateBookShelf} ></Slelf>
            
        </div>
         
    )



}
export default Shelves;
